INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3001100, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 2.1, "2024/10/31 12:00:00", 2, 130011, 100, 1, 0.0, "ヤマト", "2030/01/01 14:59:59", 3001, -416.5);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3001101, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 5.68, "2024/10/31 12:00:00", 2, 130011, 101, 4, 0.0, "ヤマト", "2030/01/01 14:59:59", 3001, -416.5);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3001102, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 0.0, "2024/10/31 12:00:00", 1, 130011, 102, 1, 0.0, "ヤマト", "2030/01/01 14:59:59", 3001, -416.5);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3002100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 0.0, "2024/10/31 12:00:00", 1, 130211, 100, 1, 0.0, "フブキ", "2030/01/01 14:59:59", 3002, -416.5);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3002101, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 0.0, "2024/10/31 12:00:00", 1, 130211, 101, 1, 0.0, "フブキ", "2030/01/01 14:59:59", 3002, -416.5);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3002102, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 8.53, "2024/10/31 12:00:00", 2, 130211, 102, 5, 0.0, "フブキ", "2030/01/01 14:59:59", 3002, -416.5);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3002103, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 5.67, "2024/10/31 12:00:00", 1, 130211, 103, 7, 0.0, "フブキ", "2030/01/01 14:59:59", 3002, -416.5);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3002104, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 0.0, "2024/10/31 12:00:00", 1, 130211, 104, 1, 0.0, "フブキ", "2030/01/01 14:59:59", 3002, -416.5);
