INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3002400, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 0.0, "2024/10/31 12:00:00", 7, 130211, 301, 7, 0.0, "フブキ", "2030/01/01 14:59:59", 3005, -416.5);
